import React from 'react';
class Search extends  React.Component {
	constructor( props ) {
		super( props );
		this.state = {
			            pokemon: '',
                        results: {},
                        loading: false,
                        message: '',
		};
	}
	render() {
		return (
			<div>
				<h2>Buscar Pokemon</h2>

				<label>
					<input
						type="text"
						value=""
						id="search-input"
						placeholder="Busca un pokemon"
					/>
				</label>
			</div>
			)
	}
}
export default Search;
